import parser


def image_captcha():
    captcha = 'testdata/zWn8.png'
    captcha_text = parser.parse(captcha)
    print('the parser#parse() result: ' + captcha_text)


def base64_image_captcha():
    captcha_base64 = 'data:image/png;base64,'
    captcha_text = parser.parse_base64(captcha_base64)
    print('the parser#parse_base64() result: ' + captcha_text)


def main():
    # zWn8 -> 2Wn8
    image_captcha()
    # zWn8 -> 2Wn8
    base64_image_captcha()


if __name__ == "__main__":
    main()
